script: |
  super -f tsv -I q993.sql | sort > q993.out

vector: true

inputs:
  - name: q993.sql
    data: |
      SELECT DISTINCT 93 + + COUNT ( col1 + col0 ) FROM tab0 WHERE NOT + + col2 NOT BETWEEN - col0 / col1 + + + col0 AND col0 * - - col2 + + col1 + - col1;
  - name: tab0

outputs:
  - name: q993.out
    data: |
      95
